import React from "react";
import { Link } from "react-router-dom";
import moment from "moment";


const PostList = ({ storedPosts }) => {
  console.log(storedPosts)
  function renderPost() {
    return (
      storedPosts &&
      storedPosts.map(post => {
        return (
          <li className="collection-item row" key={post.createdAt}>
            <Link to={"/post/" + post.id} >
              <ul>
                <li>
                <div className="card z-depth-0 project-summary">
                     <div className="card-content grey-text text-darken-3">
                       <span className="card-title">{post.startTime} {post.endTime}</span>
                        <p>{project.authorFirstName} {post.authorLastName}</p>
                        <p className="grey-text">{moment(post.createdAt.toDate().toString()).calendar()}</p>
                       </div>  
                   </div> 
                </li>
              </ul>
            </Link>
          </li>
        );
      })
    );
  }

  return (
    <div className='project-list section'>
      {renderPost()}
    </div>
  );
};

export default PostList;
